壁付け風のテレビ台を使っています。
レコーダーやゲーム類を置く場所が無く、専用の棚を付けて生活していました。

しかし最近、娘が遊ぶ時に棚に手をかけてしまうことが気になってました。
わざとではなく、下のものを取ろうとした時等に仕方なく手を置いてしまう様子。

レコーダー等が落ちてきて娘が怪我をするのも嫌だし、物が壊れるのも生活に困る。
そんなわけで移動することにしてみました。

ダイソーの木板二枚とブックスタンド、木片を組み合わせて段差を作りました。
おかげで機材同士はぶつかってないですし、コード類もうまいこと裏に通せました。
最近のダイソーは手頃な大きさの板を置いてくれてるので組み合わせが無限大で嬉しい！

PS4もbeforeの時には熱がこもりやすくて動作が心配なことがしばしば…。
前よりも前後に余裕が出てくれたから熱を放出してくれるかな？

今まであった棚は外すかフリースペースにするか要観察することに。
危険は無くなったので娘の遊び方次第かなーと。
今は気に入って遊んでるハッピーセットのドラえもんを並べてましたw

